import React from 'react';
import './App.css';
import Nav from './nav';

class App extends React.Component {

  set(){
    localStorage.setItem('user',true);
  }

  render (){
    set()
    return (
      <div className="App">
        <Nav />
      </div>
    );
  }
}

export default App;
